let i = 0;
export function nextPattern() {
  const result = 'stripes' + ((i++ % numberOfPatterns()) + 1);

  console.log('nextPattern ' + result);

  return result;
}


export function layerStyle(reference) {
  const colorFromFacet = reference.properties.tileRenderColor;
  return {
    color: colorFromFacet,
    opacity: '100%',
    fillOpacity: '20%',  
    fillColor: 'url(#' + nextPattern() +  ')'
  };
}